  input: TEXT,F3XA,,"Mr. Erik W. Koeppen, Reports Analyst             Attached is
    an amendment to the 12-Day Pre-General Report for AMERIPAC, ID# C00271338.  Regarding
    the incorrect year-to-date totals for the earmarked contributions, please note
    that they have been corrected with the FECFile v.4.         In regards to the
    incorrect year-to-date for Real Estate Investment Trusts, please note that the
    amount which was over the limit, $2,000, was refunded on October 25, 2000, which
    falls under the Post-General reporting period, so that the year-to-date on this
    report is in fact correct.  Unfortunately, the refund was mistakenly left off
    of the 30-day Post-General Report for the period (10/19/00 - 11/27/00) but will
    be reported on an amendment for that report.  Therefore, on the amended Post-General
    report, the year-to-date for Real Estate Investment Trusts will be corrected to
    $5,000.       Additionally, the office sought for the contributions made on Line
    23 has been added.     Finally, I responded to your inquiry regarding administrative
    expenses on my previous written response to this Request for Additional Information.         Thank
    you - Janica Kyriacopoulos"
